import React from "react";
import { Sidebar, Menu, MenuItem } from "react-pro-sidebar";
import { Link, BrowserRouter } from "react-router-dom";

export default function Sidebardash() {
    return (
        <div style={{ height: "100vh" }}>
            <BrowserRouter>
                <Sidebar style={{ backgroundColor: "#2e2e2e", color: "#b6c8d9" }}>
                    <Menu
                        menuItemStyles={{
                            button: {
                                "&.active": {
                                    backgroundColor: "red",
                                    color: "#b6c8d9",
                                },
                            },
                        }}
                    >
                        <MenuItem style={menuItemStyle}>
                            <Link to="/documentation">Documentation</Link>
                        </MenuItem>

                        <MenuItem style={menuItemStyle}>
                            <Link to="/calendar">Calendar</Link>
                        </MenuItem>

                        <MenuItem style={menuItemStyle}>
                            <Link to="/e-commerce">E-commerce</Link>
                        </MenuItem>
                    </Menu>
                </Sidebar>
            </BrowserRouter>
        </div>
    );
}

// External styles could also be defined in a CSS file or CSS modules
const menuItemStyle = {
    marginBottom: "10px", // Example of inline style for MenuItem
};
